sys_variable_value.value:
(function execute(inputs, outputs) {

  for(var doc = 0; doc < inputs.payload.length;doc++)
  {
    var externalApi = new x_snc_covid_svn.IngestExternalContent();
    var content = externalApi.getContentID();
    if(content.code == "200")
    {
      var docs = externalApi.ingestDocument(content.codebody,inputs.payload[doc]);
      if(docs.code == "200")
      {
        outputs.response = docs.body;
      }
      else
      {
        outputs.response = docs.body;
      }
    }
    else
    {
      outputs.response = content.body;
    }
  }

})(inputs, outputs);

