sys_variable_value.value:
(function execute(inputs, outputs) {

  for(var doc = 0; doc < inputs.payload.length;doc++)
  {
    var externalApi = new x_snc_covid_svn.IngestExternalContent();
    var content_pointer = externalApi.getContentID();
    outputs.response = JSON.stringify(externalApi.ingestDocument(content_pointer,inputs.payload[doc]));
  }

})(inputs, outputs);

